('JOB-1562347031-9B7MX-3PUZ1-DXACK-LCS0A', 'ID-1562346352-C5FI2-ZFGER-QW8WI-C61OM', 'SME DEVELOPMENT PROGRAM', 'Full Time', 'Banking', 'Sales', 'Fresh Graduate/Less Than 1 Year Experience', 'Bachelor Degree - S1', '<p>To Groom Young-Enthusiastic Candidate to be ready as qualified Small Mediumm Enterprise (SME) Relationship Manager that have responsibility too improve business productivitiy in the long run.</p>\r\n<p><strong>Placement: Jawa Timur &amp; Indonesia Timur Area</strong></p>', '<ol>\r\n<li>Bachelor degree with GPA minimum 3.00</li>\r\n<li>Maximum 27 years old</li>\r\n<li>Willing to be placed at all CIMB Niaga offices</li>\r\n<li>Preferable fresh graduate or maximum 1 year working experience</li>\r\n<li>Demonstrate the following qualities: agile, persistence, self-driven, highly motivated, energetic, good interpersonal skill, haas interest to pursue careen in Sales, goood analytical thinking and strategic thinking.</li>\r\n</ol>', 'SME DEVELOPMENT PROGRAM', 'Full Time', 'Perbankan', 'Penjualan', 'Lulusan Baru / Pengalaman Kurang dari 1 Tahun1', 'Gelar Sarjana - S1', '<p><span class=\"tlid-translation translation\" lang=\"id\"><span class=\"\" title=\"\">Kepada Calon Kandidat Muda - Antusias untuk siap sebagai Manajer Hubungan Usaha Menengah Kecil (UKM) yang memiliki tanggung jawab juga meningkatkan produktivitas bisnis dalam jangka panjang.</span><br /><br /><br /><strong><span class=\"\" title=\"\">Penempatan: Area Jawa Timur &amp; Indonesia Timur</span></strong></span></p>', '<ol>\r\n<li><span class=\"tlid-translation translation\" lang=\"id\"><span title=\"\">Gelar sarjana dengan IPK minimal 3,00</span></span></li>\r\n<li><span class=\"tlid-translation translation\" lang=\"id\"><span title=\"\">Maksimal 27 tahun</span></span></li>\r\n<li><span class=\"tlid-translation translation\" lang=\"id\"><span title=\"\">Bersedia ditempatkan di semua kantor CIMB Niaga</span></span></li>\r\n<li><span class=\"tlid-translation translation\" lang=\"id\"><span title=\"\">Lulusan baru yang disukai atau pengalaman&amp;</span></span></li>\r\n</ol>', 'UMR Kota Bandung', 1, 'JOB-1562347031-9B7MX-3PUZ1-DXACK-LCS0A-PIC.jpg', '2019-08-31', 'Y', 'N', 'Y', 'N', 'Y', 'N', NULL, NULL, '2019-07-07 14:20:08'),
